public void edges_checkReturnedSetMutability() {
  Set<String> edges = network.edges();
  try {
    edges.add(E12);
    fail(ERROR_MODIFIABLE_COLLECTION);
  } catch (UnsupportedOperationException e) {
    addEdge(N1, N2, E12);
    assertThat(network.edges()).containsExactlyElementsIn(edges);
  }
}

